import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import './App.css';
import Section from './componentes/section/section';


function App() {
  return (

        <div className="App">
          <BrowserRouter>

            <Route exact path='/Section' component={Section} />
          </BrowserRouter>


    </div>
  );
}

export default App;
